    false,nt"url": null,nt"notes": "Proposal for "The role of the Ft. Niobrara
    Wildlife Refuge and Sullys Hill Wildlife Preserve in the long-term management of
    Federal bison herds" project created by the Texas Agricultural Experiment Station
    at  Texas A&M University, and submitted to The U.S. Department of the Interior,
    U.S. Geological Survey & the U.S. Fish and Wildlife Service.  This project researches
    genetic information regarding bison population structure and genetic integrity on
    parks and refuges. Federal managers charged with conserving bison germplasm must
    know whether animals with hybrid backgrounds exist in these herds in order to prevent
    hybrid perpetuation. In addition, managers must be able to define the population
    structures or their herds in order to test the effect of various population sizes
    and removal strategies on genetic diversity. This information will clarify the best
    management strategies for the long-term preservation of bison germplasm.",nt"license_title":
